import React from 'react';
const LogItem = () => {
    return (
        <div>
            <div className='date'>
            <div className='month'>
                四月
            </div>
            <div className='day'>
                19日
            </div>
        </div>
        {/* 日志内容的容器 */}
        <div className='content'>
            <h2 className='desc'>学习React</h2>
            <div className='time'>
                40分钟
            </div>
        </div>
        </div>
    );
};
export default LogItem;
